import Button from "./Button";
import styles from "./App.module.css";
import { useState } from "react";

function App() {
  const [counter, setValue] = useState();
  const onClick = () => setValue((prev) => prev + 1);
  return (
    <div>
      <h1>Welcome</h1>
      <Button text={"Continue "}/>
    </div>
  );
}

export default App;
